USE bid_blast_database;

DELETE FROM offers WHERE id_offer >= 1;

DELETE FROM auction_reviews WHERE id_auction_review >= 1;
DELETE FROM black_lists WHERE id_black_list >= 1;
DELETE FROM auctions_states_applications WHERE id_auction_state_application >= 1;
DELETE FROM hypermedia_files WHERE id_hypermedia_file >= 1;
DELETE FROM auctions WHERE id_auction >= 1;
DELETE FROM auction_states WHERE id_auction_state >= 1;
DELETE FROM auction_categories WHERE id_auction_category >= 1;
DELETE FROM item_conditions WHERE id_item_condition >= 1;

DELETE FROM accounts_roles WHERE id_account_rol >= 1;
DELETE FROM roles WHERE id_rol >= 1;
DELETE FROM accounts WHERE id_account >= 1;
DELETE FROM profiles WHERE id_profile >= 1;

